import React from "react";
import "./home.css";
import { Link } from "react-router-dom";

function Nav() {
  return (
      <div className="navbar">
        <ul className="navContainer">
          <li>JC</li>
          <li>
            <Link className="link" to="/" style={{ textDecoration: "none" }}>
              Home
            </Link>
          </li>
          <li>
            <a style={{ textDecoration: "none" }} href="#about-me-section">About Me</a>
          </li>
          <li>Portfolio</li>
          <li>Resume</li>
          <button className="button-17" role="button">
            <li>CONTACT ME</li>
          </button>
        </ul>
      </div>
  );
}

export default Nav;
